sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
  var name = inputs.name.replace(/ /g,'');
  var cn = inputs.cn;
  if(cn.indexOf('★') != -1){
	cn = cn.replace('★','%E2%98%85%27');
	cn = '%27' + cn;
  }
  else{
  	cn = inputs.cn;
  }
  var url = 'https://api.scryfall.com/cards/search?q=set:'+inputs.set+'+'+name+"+cn:'"+cn + "'";
 outputs.url = url;
})(inputs, outputs);

